//Typed.js Instance
document.addEventListener('DOMContentLoaded', function() {
    var typed = new Typed('#typed', {
        strings: [
            '...in family',
            '...in business',
            '...in nature',
            '...in fun',
            '...in life'
        ],
        typeSpeed: 100,
        backSpeed: 100,
        startDelay: 1000,
        backDelay: 1000,
        loop: true,
        loopCount: Infinity,
        showCursor: true,
        cursorChar: 'I',
        smartBackspace: false
    });
});

//Calculators
jQuery('#showcalc').click(function(e){
    e.preventDefault();
    jQuery('#monthlycalc').slideToggle();
});
jQuery('#resetit').click(function(e){
    e.preventDefault();
    jQuery('#calcresults').html('');
    jQuery('#monthlycalc input').val('');
});
function numberWithCommas(x){
    if(isNaN(x)){ x=0; }
    return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
}
jQuery('#calcit').click(function(e){
    e.preventDefault();
    var pp=jQuery('#pprice').val();
    var dp=jQuery('#dpamt').val();
    var loanamt=pp - dp;
    var intrate=jQuery('#intrate').val();
    var years=jQuery('#numyears').val();
    var months=years * 12;
    var camt=intrate / 100;
    camt=camt / 12;
    var cfirst=1 + camt;
    cfirst=Math.pow(cfirst, months);
    cfirstf=camt * cfirst;
    var csecond=cfirst - 1;
    var payment=loanamt * cfirstf;
    payment=payment / csecond;
    payment=payment.toFixed(2);
    var finalamt=payment * months;
    finalamt=finalamt - loanamt;
    finalamt=finalamt.toFixed(2);
    jQuery('#calcresults').html('<div class="row"><div class="col-sm-4">Amount financed:<h4>$</sup>' + numberWithCommas(loanamt) + '</h4></div><div class="col-sm-4">Monthly payment:<h4>$' + numberWithCommas(payment) + '</h4></div><div class="col-sm-4">Total interest:<h4>$' + numberWithCommas(finalamt) + '</h4></div></div>');});


